import React from 'react';
import { Row } from 'react-bootstrap';
import './Sidebar.css';

class Sidebar extends React.Component{
    render(){
        return(
            <Grid>
                <Row className = "show-grid">
                    <Col xs={6} md={4}>
                        <h1>Hello</h1>
                    </Col>
                </Row>
            </Grid>        
        )
    }
}

export default Sidebar;
